import React from "react";
import {Navbar} from "./Components/Header/navbar"
import {Body} from "./Components/Products/Body"
import 'boxicons';

function ItemListContainer(props) {
  console.log(props);

  return(
      <div className="props">
       <p>{props.message}</p>   
      </div>
  );
}
function App() {
  return (
    <div className="App">

      <Navbar />
      <Body />

      <ItemListContainer message="Error"/>





    </div>
  );
}

export default App;
